int d[19];
int nxt[19][10];

int load(int x) {
	int n = 0;
	while (x) {
		d[n++] = x % 10;
		x /= 10;
	}

	for (int i = 0; i < 10; ++i) nxt[0][i] = -1;
	for (int i = 1; i <= n; ++i) {
		for (int j = 0; j < 10; ++j) {
			if (d[i - 1] == j) nxt[i][j] = i - 1;
			else nxt[i][j] = nxt[i - 1][j];
		}
	}
	return n;
}

bool check(int y, int m) {
	static int e[20];
	int n = 0;
	while (y) {
		e[n++] = y % 10;
		y /= 10;
	}

	int p = m;
	for (int i = n - 1; i >= 0; --i) {
		p = nxt[p][e[i]];
		if (p == -1) return false;
	}
	return true;
}

int calc(int n) {
	if (n == 0) return 0;
	const int chunk = 1e5;
	int pd = n / chunk;
	int ans = 0;
	for (int i = 0; i < pd; ++i) {
		ans += tabl[i];
	}

	int ps = pd * chunk;
	for (int i = ps; i <= n; ++i) {
		if (i == 0) continue;
		int m = load(i);
		for (int j : avoids) {
			if (j > i) break;
			if (check(j, m)) goto ED2;
		}

		ans += 1;
ED2:		continue;
	}
	return ans;
}

